"use strict";

var _index = require("../index.js");
/* eslint-disable import/namespace */

describe('final-form named export', () => {
  it('should re-export the expected exports', () => {
    const exports = Object.keys(_index.FinalForm);
    expect(exports).toMatchSnapshot();
  });
  it.each(Object.keys(_index.FinalForm))('should re-export the expected type for %s', exportName => {
    const type = typeof _index.FinalForm[exportName];
    expect(type).toMatchSnapshot();
  });
});
